import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import Button from '@material-ui/core/Button'
import Particles from 'react-particles-js'
import Grid from '@material-ui/core/Grid'
import Avatar from '@material-ui/core/Avatar'
import Card from "@material-ui/core/Card"

const particleOpt = {
  particles: {
    number: {
      value: 100,
      density: {
        enable: false,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    return (
      <React.Fragment>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <div className="wrapper">
          <div className="introduction">
            <Avatar className="avatar" alt="Profile Picture" size="large" src="/img/maicon.png" />
            <hgroup>
              <h1 align="center">Hello, I'm <span>Maicon Esteves</span></h1>
              <h2 align="center">I'm a full-stack developer</h2>
            </hgroup>
            <Button className="bt-index" variant="outlined" size="large" color="secondary" href="home">Default</Button>
          </div>
        </div>
      </React.Fragment>
    )
}

export default Index
